from unittest import TestCase
from service.image_service import ImageService
from constants import C_FRONT_ABSOLUTE_PATH


class TestImageService(TestCase):

    handle = ImageService()
    C_PATH_TEST = C_FRONT_ABSOLUTE_PATH

    def test_convert_img(self):
        image_test = "data:image/jpeg;base64,"
        image_test = image_test[23:].encode(encoding="utf-8")

        self.handle.decode_img(absolute_path=self.C_PATH_TEST, store_name="testStore", original_image=image_test)
        self.assertEqual(1, 1)

        # TODO remove:'data:image/jpeg;base64,'

    def test_save_image(self):
        self.handle.save_image(image=self.img2, path=self.C_PATH_TEST, file_name="new")
        self.assertEqual(1, 1)

    def test_open_image(self):
        img2 = self.handle.open_image(C_FRONT_ABSOLUTE_PATH + 'plie/product/big/temp_work_image.jpg')
        self.assertEqual(img2, img2)

    def test_resize_img(self):
        img5 = self.handle.resize_img(img=self.img2)
        self.handle.save_image(image=img5, path=self.C_PATH_TEST, file_name="resz")
        self.assertEqual(1, 1)

    def test_crop_img(self):
        img4 = self.handle.crop_img(self.img2)
        self.handle.save_image(image=img4, path=self.C_PATH_TEST, file_name="crop")
        self.assertEqual(1, 1)

    def test_create_thumbnail(self):
        img3 = self.handle.create_thumbnail(img=self.img2)
        self.handle.save_image(image=img3, path=self.C_PATH_TEST, file_name="thumb")
        self.assertEqual(1, 1)
